\u0412\u043e\u043f\u0440\u043e\u0441 100.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Взрослый билет стоил 15 евро, юношеский - 10, детский - 5;
дифференциация цены билетов в музеях обычно тоже зависит от возрастной
категории посетителей.

\u0412\u043e\u043f\u0440\u043e\u0441 175.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
ИКС - хоббит; у Толкиена есть произведение "Хоббит, или Туда и обратно";
по версии, которую сам Толкиен отрицал, слово "хоббит" произошло от слов
"homo" и "rabbit".

\u0412\u043e\u043f\u0440\u043e\u0441 189.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Голу Давыдова пяткой отдали предпочтение более 50 тысяч болельщиков;
Тейяб Авана чудом избежал наказания за гол, который он забил с пенальти
ударом пяткой.
